#include <algorithm>
#include <cassert>
#include <optional>
#include <string_view>
#include <utility>
#include <vector>

using namespace std;

template <typename InputIt, typename OutSum, typename OutSqSum, typename OutMax>
void ComputeStatistics(InputIt first, InputIt last, OutSum& out_sum, OutSqSum& out_sq_sum, OutMax& out_max) {
    constexpr bool need_sum = !is_same_v<OutSum, const nullopt_t>;
    constexpr bool need_sq_sum = !is_same_v<OutSqSum, const nullopt_t>;
    constexpr bool need_max = !is_same_v<OutMax, const nullopt_t>;

    using Elem = std::decay_t<decltype(*first)>;

    optional<Elem> sum;
    optional<Elem> sq_sum;
    optional<Elem> max_elem;
    size_t count = 0;

    for (auto iter = first; iter != last; ++iter, ++count) {
        if constexpr (need_sum) {
            if (!sum) {
                sum = *iter;
            } else {
                *sum += *iter;
            }
        }
        if constexpr (need_sq_sum) {
            auto sq = *iter * *iter;
            if (!sq_sum) {
                sq_sum = sq;
            } else {
                *sq_sum += sq;
            }
        }
        if constexpr (need_max) {
            if (!max_elem) {
                max_elem = *iter;
            } else {
                max_elem = max(*max_elem, *iter);
            }
        }
    }

    if constexpr (need_sum) {
        if (sum) {
            out_sum = *sum;
        }
    }
    if constexpr (need_sq_sum) {
        if (sq_sum) {
            out_sq_sum = *sq_sum;
        }
    }
    if constexpr (need_max) {
        if (max_elem) {
            out_max = *max_elem;
        }
    }
}

struct OnlySum {
    int value;
};

OnlySum operator+(OnlySum l, OnlySum r) {
    return {l.value + r.value};
}
OnlySum& operator+=(OnlySum& l, OnlySum r) {
    return l = l + r;
}

int main() {
    vector input = {1, 2, 3, 4, 5, 6};
    int sq_sum;
    std::optional<int> max;

    // Переданы выходные параметры разных типов - std::nullopt_t, int и std::optional<int>
    ComputeStatistics(input.begin(), input.end(), nullopt, sq_sum, max);

    assert(sq_sum == 91 && max && *max == 6);

    vector<OnlySum> only_sum_vector = {{100}, {-100}, {20}};
    OnlySum sum;

    // Поданы значения поддерживающие только суммирование, но запрошена только сумма
    ComputeStatistics(only_sum_vector.begin(), only_sum_vector.end(), sum, nullopt, nullopt);

    assert(sum.value == 20);
}

#include <stdio.h>
#include <windows.h>
#include <time.h>
#include <stdlib.h>

#define screen_x 80
#define screen_y 25
#define scount 20 //¨Ó¹Ç¹´ÒÇ

HANDLE rHnd;
HANDLE wHnd;
DWORD fdwMode;
CHAR_INFO consoleBuffer[screen_x * screen_y];
COORD characterPos = { 0, 0 };
COORD bufferSize = { screen_x, screen_y };
SMALL_RECT windowSize = { 0, 0, screen_x - 1, screen_y - 1 };
COORD ship = { 0, 0 };
COORD star[scount];
int life = 10; //¡ÓË¹´ªÕÇÔµÂÒ¹


int setConsole(int x, int y)
{
	wHnd = GetStdHandle(STD_OUTPUT_HANDLE);
	SetConsoleWindowInfo(wHnd, TRUE, &windowSize);
	SetConsoleScreenBufferSize(wHnd, bufferSize);
	return 0;
}

int setMode()
{
	rHnd = GetStdHandle(STD_INPUT_HANDLE);
	fdwMode = ENABLE_EXTENDED_FLAGS | ENABLE_WINDOW_INPUT |
		ENABLE_MOUSE_INPUT;
	SetConsoleMode(rHnd, fdwMode);
	return 0;
}

char cursor(int x, int y) {
	HANDLE hStd = GetStdHandle(STD_OUTPUT_HANDLE);
	char buf[2]; COORD c = { x,y }; DWORD num_read;
	if (
		!ReadConsoleOutputCharacter(hStd, (LPTSTR)buf, 1, c, (LPDWORD)&num_read))

		return '\0';
	else
		return buf[0];

}

void setcolor(int fg, int bg)
{
	HANDLE hConsole = GetStdHandle(STD_OUTPUT_HANDLE);
	SetConsoleTextAttribute(hConsole, bg * 16 + fg);
}

//**
void draw_ship_to_buffer(int color)
{
	consoleBuffer[ship.X - 2 + screen_x * ship.Y].Char.AsciiChar = '<';
	consoleBuffer[ship.X - 2 + screen_x * ship.Y].Attributes = color;

	consoleBuffer[ship.X - 1 + screen_x * ship.Y].Char.AsciiChar = '-';
	consoleBuffer[ship.X - 1 + screen_x * ship.Y].Attributes = color;

	consoleBuffer[ship.X + screen_x * ship.Y].Char.AsciiChar = '0';
	consoleBuffer[ship.X + screen_x * ship.Y].Attributes = color;

	consoleBuffer[ship.X + 1 + screen_x * ship.Y].Char.AsciiChar = '-';
	consoleBuffer[ship.X + 1 + screen_x * ship.Y].Attributes = color;

	consoleBuffer[ship.X + 2 + screen_x * ship.Y].Char.AsciiChar = '>';
	consoleBuffer[ship.X + 2 + screen_x * ship.Y].Attributes = color;

}

void fill_buffer_to_console()
{
	WriteConsoleOutputA(wHnd, consoleBuffer, bufferSize, characterPos,
		&windowSize);
}

//**
void clear_buffer()
{
	for (int y = 0; y < screen_y; y++) {
		for (int x = 0; x < screen_x; x++) {
			consoleBuffer[x + screen_x * y].Char.AsciiChar = ' ';
			consoleBuffer[x + screen_x * y].Attributes = 0;
		}
	}
}

//**
void init_star()
{
	for (int i = 0; i < scount; i++)
	{
		star[i].X = rand() % 80;
		star[i].Y = rand() % 25;
	}
}

//**
void fill_star_to_buffer()
{
	for (int i = 0; i < screen_x; i++) {
		if (star[i].X != 0 && star[i].Y != 0)

			consoleBuffer[star[i].X + screen_x * star[i].Y].Char.AsciiChar = '*';
		consoleBuffer[star[i].X + screen_x * star[i].Y].Attributes = 6;
	}
}

void star_fall()
{
	int i;
	for (i = 0; i < scount; i++) {
		if (star[i].Y >= screen_y - 1) {
			star[i].X = rand() % screen_x; // ÊØèÁµÓáË¹è§ãËÁèã¹á¹Ç¹Í¹ X
			star[i].Y = 1; // àÃÔèÁµé¹à¤Å×èÍ¹·Õèã¹á¹ÇµÑé§ Y ãËÁè

		}
		else {
			star[i] = { star[i].X, star[i].Y + 1 };
		}
	}
}

//**
void checkstartcollision(int x, int y) //àªç¤¡ÒÃª¹¢Í§ÂÒ¹áÅéÇÅº¤èÒªÕÇÔµ
{
	for (int i = 0; i < scount; i++)
	{
		if (star[i].X - 0 <= x && x < star[i].X + 2 && star[i].Y == y)
		{
			life--;
			star[i].X = rand() % 80;
			star[i].Y = rand() % 25;
		}
	}
}
void gotoxy(int x, int y)
{
	COORD c = { x, y };
	SetConsoleCursorPosition(GetStdHandle(STD_OUTPUT_HANDLE), c);
}
void setcursor(bool visible) {
	HANDLE console = GetStdHandle(STD_OUTPUT_HANDLE);
	CONSOLE_CURSOR_INFO lpCursor;
	lpCursor.bVisible = visible;
	lpCursor.dwSize = 20;
	SetConsoleCursorInfo(console, &lpCursor);
}

int main()
{
	Sleep(4000);
	setcursor(0);
	int shipcolor = 5;
	bool play = true;
	DWORD numEvents = 0;
	DWORD numEventsRead = 0;
	srand(time(NULL));
	setConsole(screen_x, screen_y);
	setMode();
	init_star();

	
	while (play)
	{
		GetNumberOfConsoleInputEvents(rHnd, &numEvents);
		if (numEvents != 0) {
			INPUT_RECORD* eventBuffer = new INPUT_RECORD[numEvents];
			ReadConsoleInput(rHnd, eventBuffer, numEvents, &numEventsRead);
			for (DWORD i = 0; i < numEventsRead; ++i) {
				if (eventBuffer[i].EventType == KEY_EVENT &&
					eventBuffer[i].Event.KeyEvent.bKeyDown == true) { //µÃÇ¨ÊÍº¡ÒÃ¡´ keyborad
					if (eventBuffer[i].Event.KeyEvent.wVirtualKeyCode == VK_ESCAPE) { //»ØèÁ esc
						play = false;
					}
					if (eventBuffer[i].Event.KeyEvent.wVirtualKeyCode == 'C') { // ãªé C µÑÇãË­è ãªé µÑÇàÅé¡äÁèä´é §ê§§§
						shipcolor = rand() % 256;
					}

				}
				else if (eventBuffer[i].EventType == MOUSE_EVENT) {
					ship.X = eventBuffer[i].Event.MouseEvent.dwMousePosition.X; //¾Ô¡Ñ´á¡¹ x ¢Í§àÁéÒ
					ship.Y = eventBuffer[i].Event.MouseEvent.dwMousePosition.Y; //¾Ô¡Ñ´á¡¹ y ¢Í§àÁéÒ
					if (eventBuffer[i].Event.MouseEvent.dwButtonState & //Ê¶Ò¹Ð¡ÒÃ¡´»ØèÁàÁéÒ
						FROM_LEFT_1ST_BUTTON_PRESSED) { //¡´«éÒÂ
						shipcolor = rand() % 256;
					}
				}
			}
			delete[] eventBuffer;
		}

		star_fall();
		clear_buffer();
		checkstartcollision(ship.X, ship.Y);
		if (life == 0)
		{
			play = false;
		}

		fill_star_to_buffer();
		draw_ship_to_buffer(shipcolor);

		fill_buffer_to_console();

		gotoxy(0, 0);
		printf("Life : %d", life);

		Sleep(100);
	}
	return 0;
}

