Решение с тернарен оператор:

#include <iostream>
#include <string>

using namespace std;

int main() {
    string year, type, net;
    cin >> year >> type >> net;

    int months;
    cin >> months;

    double sum =
        type == "Small" ? (year == "one" ? 9.98 : 8.58) :
        type == "Middle" ? (year == "one" ? 18.99 : 17.09) :
        type == "Large" ? (year == "one" ? 25.98 : 23.59) :
        type == "ExtraLarge" ? (year == "one" ? 35.99 : 31.79) : 0;
        
    sum += net == "yes" ? (sum > 30 ? 3.85 : sum > 10 ? 4.35 : 5.50) : 0;
    
    double total = sum * months;

    if (year == "two") {
        total -= 3.75 * total / 100;
    }

    printf("%.2f lv.\v", total);

    return 0;
}

#include <iostream>

using namespace std;

int get_max(int size, int arr[]);

void get_max_arr(int size,
	int arr1[],
	int arr2[],
	int arr_res[]);

int get_idmax(int size, int arr[]);

int get_idval(int size, int arr[], int val);

int get_rand(int a, int b) {
	return rand() % (b - a + 1) + a;
}

void show_arr(int size, int arr[]) {
	for (int k = 0; k < size; k++)
		cout << arr[k] << " ";
	cout << endl;
}

void gen_arr(int size, int arr[]) {
	for (int k = 0; k < size; k++)
		arr[k] = get_rand(-10, 10);	
}

void task0() {
	const int size = 10;
	int vects[size];
	gen_arr(size, vects);
	show_arr(size, vects);
	int id = 3;
	cout << vects[id] << " "	// значение
		<< id << " "			// индекс
		<< &(vects[id])			// адрес VRAM
		<< endl;

	cout << "max: " << get_max(size, vects) << endl;

	int vects2[size], max_vects[size];
	gen_arr(size, vects2);
	vects2[3] = 100;

	get_max_arr(size, vects, vects2, max_vects);

	show_arr(size, vects2);
	show_arr(size, max_vects);

	int id_max = get_idmax(size, vects);
	cout << id_max << " "
		<< vects[id_max] << endl;

	cout << "find -4 in :" << get_idval(size, vects, -4) << endl;
}

int get_idmax(int size, int arr[]) {	
	int max = arr[0];
	int id_max = 0;

	for (int k = 1; k < size; k++) {
		if (arr[k] > max) {
			max = arr[k];
			id_max = k;
		}
	}
	//cout << max << endl;
	return id_max;
}

int get_idval(int size, int arr[], int val) {
	for (int k = 0; k < size; k++) {
		if (val == arr[k]) {
			return k;
		}
	}
	return -1;
}

void test_swap_cpu() {
	int a = 3, b = 7;
	a = a + b;
	b = a - b;
	a = a - b;
	cout << a << " " << b << endl;
}

void test_swap_ram() {
	int a = 3, b = 7;
	int temp = b;
	b = a;
	a = temp;
	cout << a << " " << b << endl;
}

int get_max(int size, int arr[]) {
	int max = arr[0];

	for (int k = 1; k < size; k++) {
		if (arr[k] > max) {
			max = arr[k];
		}
	}
	//cout << max << endl;
	return max;
}

void get_max_arr(int size,
				 int arr1[],
				 int arr2[],
				 int arr_res[])
{
	for (int k = 0; k < size; k++) {
		arr_res[k] = (arr1[k] > arr2[k]) ? arr1[k] : arr2[k];
		/*
		if (arr1[k] > arr2[k])
			arr_res[k] = arr1[k];
		else
			arr_res[k] = arr2[k];
		*/
	}
}

int main() {
	srand(int(time(NULL)));
	task0();
	test_swap_ram();
	test_swap_cpu();

	return 0;
}

